void* javascript4_parse(const char *text, size_t len, void *thunk, void* (*fnew)(symbol_t, const unsigned char *, size_t, size_t, void *), void  (*fset)(void *, size_t, symbol_t, void *, void *), void  (*fgc)(void *, int, void *)){
   void* result = NULL;
   ParserContext * c = ParserContext_new((const unsigned char*)text, len);
   ParserContext_initTreeFunc(c,thunk,fnew,fset,fgc);
   ParserContext_initMemo(c,64/*FIXME*/,118);
   if (p_046File(c)){
      printf("total backtrack count: %ld\n", backtrack_count);
      printf("longest backtrack length: %ld\n", backtrack_length);
      printf("total backtrack length: %ld\n", total_backtrack_length);
      result = c->left;
      if (result == NULL){
         result = c->fnew(0, (const unsigned char*)text, (c->pos - (const unsigned char*)text), 0, c->thunk);
      }
   }
   ParserContext_free(c);
   return result;
}
static void* cnez_parse(const char *text, size_t len){
   return javascript4_parse(text, len, NULL, NULL, NULL, NULL);
}
long javascript4_match(const char *text, size_t len){
   long result = -1;
   ParserContext * c = ParserContext_new((const unsigned char*)text, len);
   ParserContext_initNoTreeFunc(c);
   ParserContext_initMemo(c,64/*FIXME*/,118);
   if (p_046File(c)){
      result = c->pos-c->inputs;
   }
   ParserContext_free(c);
   return result;
}
const char* javascript4_tag(symbol_t n){
   return _tags[n];
}
const char* javascript4_label(symbol_t n){
   return _labels[n];
}
